CREATE TABLE IF NOT EXISTS consulti.ciudad
(
    id uuid NOT NULL,
    nombre character varying(100) COLLATE pg_catalog."default" NOT NULL,
    provincia_id uuid NOT NULL,
    fecha_creacion timestamp without time zone NOT NULL,
    user_creacion character varying(100) COLLATE pg_catalog."default" NOT NULL,
    fecha_modificacion timestamp without time zone,
    user_modificacion character varying(100) COLLATE pg_catalog."default",
    estado character varying(100) COLLATE pg_catalog."default" NOT NULL,
    CONSTRAINT ciudad_pkey PRIMARY KEY (id)
)

TABLESPACE pg_default;

ALTER TABLE consulti.ciudad
    OWNER to postgres;

ALTER TABLE ONLY consulti.ciudad
    ADD CONSTRAINT ciudad_provincia_id_fk FOREIGN KEY (provincia_id) REFERENCES consulti.provincia(id);

